  componentDidMount() {
     axios.get('/api/maas360')
       .then((response) => {
         console.log(response);
         this.setState({ data: response.data });
       })
       .catch((error) => {
         console.log(error);
       });
   }


  render() {
    const device = this.state.data[0]; // get the first device in the array
    const name = device ? device.name : "No Devices Found"; // check if device exists, if not set name to empty string
    return (
      <div>
        <h2>Name of the first device:</h2>
        <p>{name}</p>
      </div>
    );
  }
}

export default Maas360Data;
